import 'package:weatherdemo/core/utils/extension_function/string_extension.dart';class WeatherTemp {  int? id;  String? main;  String? description;  String? icon;  WeatherTemp(this.id, this.main, this.description, this.icon);  WeatherTemp.fromJson(dynamic json) {    id = json['id'];    main = json['main'];    description = json['description'];    icon = json['icon'];  }}